description:
Weest in geen ding bezorgd; maar laat uw begeerten in alles, door bidden en
smeken met dankzegging bekend worden bij God. En de vrede Gods, die alle
verstand te boven gaat, zal uw harten en uw zinnen bewaren in Christus Jezus.

